import logo from './logo.svg';
import './App.css';


const App = () => {
  return (
    <div>
      <header>
        <img src="https://www.google.com/imgres?imgurl=https%3A%2F%2Fupload.wikimedia.org%2Fwikipedia%2Fcommons%2F5%2F52%2FFree_logo.svg&tbnid=xthFQte18junFM&vet=12ahUKEwin0rjv8JOBAxWC6CoKHYVFAXQQMygAegQIARBS..i&imgrefurl=https%3A%2F%2Fcommons.wikimedia.org%2Fwiki%2FFile%3AFree_logo.svg&docid=lT8mUH9laqCnqM&w=600&h=250&q=logo%20free&ved=2ahUKEwin0rjv8JOBAxWC6CoKHYVFAXQQMygAegQIARBS"></img>
      </header>


    </div>
  );
}
export default App;
